import re
import os
import urllib.request as req
from random import randint

dir = "./"
filename = []
indexfile = ["BO2.jpg","driver.jpg","gta5.jpg","guildwars2.jpg","maxpayne3.jpg","mw3.jpg","se2.jpg","skyrim.jpg","walkingdead.jpg"]
indexurl = "data:image/jpeg;base64,"
imgurl1 = "https://i.kym-cdn.com/entries/icons/mobile/000/030/967/spongebob.jpg"
imgurl2 = "data:image/jpeg;base64,"
imgurl3 = "data:image/jpeg;base64,"
imgurl4 = "data:image/jpeg;base64,"
imgurl5 = "data:image/jpeg;base64,"
imgurl6 = "data:image/jpeg;base64,"

#Change images in game_images using roulette
os.chdir("../")
for file in os.listdir(dir):
    if "jpg" in file:
        filename.append(file)
for name in filename:
    value = randint(1,6)
    if value==1:
        imgurl = imgurl1
    if value==2:
        imgurl = imgurl2
    if value==3:
        imgurl = imgurl3
    if value==4:
        imgurl = imgurl4
    if value==5:
        imgurl = imgurl5
    if value==6:
        imgurl = imgurl6
    req.urlretrieve(imgurl, name)
    
#Change dir then images in slider images to hackerman
os.chdir("../images")
filename.clear()
for file in os.listdir(dir):
    if "index_r2_c2" in file:
        if "jpg" in file:
            filename.append(file)
for name in filename:
    req.urlretrieve(indexurl, name)
    
#Change the 9 images
for name in indexfile:
    req.urlretrieve(indexurl, name)